    const Toggle = () => {
        setToggle(!toggle)
    }
    return <>
        <Header />
        <div className='container-fluid bg-secondary min-vh-100'>
            <div className='row'>
                {toggle && <div className='col-4 col-md-2 bg-white vh-100'>

                </div>}

                {toggle && <div className='col-1'></div>}
                <div className='col'>

                </div>
            </div>
        </div>
    </>
}

export default AdminLayout
